import React from 'react'
import NavbarComp from '../Components/NavbarComp';
import Particles from "react-particles-js";

export default function Home() {
    
    
    return (
        
        <>
         <Particles
   className="particles-canvas"
   params={{
   particles: {
     number: {
       value:30,
       density:{
         enable:true,
         value_area: 900
       }
     },
     shape:{
       type: "circle",
       stroke: {
         width:6,
         color:"#f9ab00"
       }
     }
   }

   }}


   />
        <NavbarComp />
        
        </>
    )
}
